import axios from 'axios';

export const addDiary = (diary) => {
    return (dispatch, getState) => {
        axios
        .post("http://localhost:3001/diaries/new", diary)
        .then(diary => {
            dispatch({
                type: "ADD_DIARY",
                diary
            })
        })
        .catch(error => {
            console.log(error.response)
        })
    }
}
